import React from "react";
import { getStudentByID } from "../store/actions/studentActions";
import { connect } from "react-redux";

const detailStd = ({ match }) => {
  var get_std = this.PaymentResponse.getStudentByID(match.params.sid);
  return (
    <h1> {get_std.s_name}</h1>
  
  );
};
export default connect(null,{getStudentByID})(detailStd);
